import React from 'react'
import TodoList from './components/TodoList'

const App = () => {

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return (

    <>
      <TodoList />
    </>
  )
}

export default App
